import React, { useState } from 'react';
import EmotionInput from '../components/EmotionInput';
import { BACKEND_URL } from '../config';
import '../styles/HomePage.css';

export default function HomePage() {
  const [result, setResult] = useState(null);

  // üéº Nota parametreleri...
  const notes = Array.from({ length: 20 }).map((_, i) => ({
    id: i,
    left: Math.random() * 100,
    fallDur: 8 + Math.random() * 6,
    swayDur: 3 + Math.random() * 3,
    size: 16 + Math.random() * 24,
    color: `hsl(${Math.random() * 360}, 80%, 75%)`
  }));

  // Feedback g√∂nder
  const sendFeedback = async (trackId, liked) => {
    try {
      await fetch(`${BACKEND_URL}/api/feedback`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ track_id: trackId, liked })
      });
    } catch (e) {
      console.error('Feedback error', e);
    }
  };

  return (
    <div className="homepage">
      {/* üéº Notalar */}
      <div className="notes-container">
        {notes.map(n => (
          <span
            key={n.id}
            className="note"
            style={{
              left: `${n.left}%`,
              '--fall-dur': `${n.fallDur}s`,
              '--sway-dur': `${n.swayDur}s`,
              '--note-size': `${n.size}px`,
              '--note-color': n.color
            }}
          >‚ô™</span>
        ))}
      </div>

      <h1>Duygu Analizi + M√ºzik √ñneri</h1>
      <div className="emotion-section">
        <EmotionInput onResults={setResult} />
      </div>

      {result && (
        <div className="results">
          <div className="details">
            {/* ...mevcut detaylar */}
          </div>
          <div className="music-list">
            {result.recommended_music.map((uri) => {
              const trackId = uri.split(':').pop();
              return (
                <div key={trackId} className="music-card">
                  <iframe
                    title={trackId}
                    src={`https://open.spotify.com/embed/track/${trackId}`}
                    allow="autoplay; encrypted-media"
                  />
                  {/* üëçüëé butonlarƒ± */}
                  <div className="track-actions">
                    <button onClick={() => sendFeedback(trackId, true)}>üëç</button>
                    <button onClick={() => sendFeedback(trackId, false)}>üëé</button>
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      )}
    </div>
  );
}
